import React from 'react';
import { useSelector } from 'react-redux';
import * as THREE from "three";
import styled from 'styled-components';
import {Row, Col, Tabs, Menu} from 'antd';
import AppLayout from '../components/AppLayout';
// import PostForm from '../components/PostForm';
// import PostCard from '../components/PostCard';

const { SubMenu } = Menu;
const { TabPane } = Tabs;
const TowerViewSection = styled.div`
  position: relative;
  background : #F6F7F9;
  max-width: 1350px;
  height: 87vh;
  margin: 0 auto;
  padding-top: 30px;
  padding-left: 30px;
  padding-right: 30px;
`;

const SettingSection = styled.div`
  position: relative;
  height: 87vh;
  margin: 0 auto;
  padding-top: 30px;
  padding-inline: 5%;
`;

const CustomTabs = styled(Tabs)`
  .ant-tabs-tab {
    padding-inline : 1em;
  }
  .ant-tabs-tab-btn {
    font-size: medium;
    font-weight: bold;
    margin: 0 auto;
  }
`

/*Three.js*/


const Home = () => {
  // const { isLoggedIn } = useSelector(state => state.user);
  // const { mainPosts } = useSelector(state => state.post);

  return (
    <AppLayout>
      <Row>
        <Col xs={8} lg={4}>
          <Menu mode="inline"> 
            <SubMenu key="Component" title="Components" style={{fontWeight:'bold'}}>
              <Menu.Item key="Shell body"style={{fontWeight:'normal'}}>Shell body</Menu.Item>
              <Menu.Item key="Flanges"style={{fontWeight:'normal'}}>Flanges</Menu.Item>
              <Menu.Item key="Bolts"style={{fontWeight:'normal'}}>Bolts</Menu.Item>
              <Menu.Item key="Welds"style={{fontWeight:'normal'}}>Welds</Menu.Item>              
            </SubMenu>
            <SubMenu key="Analysis" title="Analysis" style={{fontWeight:'bold'}}>
              <Menu.Item key="Eigen frequency"style={{fontWeight:'normal'}}>Eigen frequency</Menu.Item>
              <Menu.Item key="Extraem"style={{fontWeight:'normal'}}>Extraem</Menu.Item>
              <Menu.Item key="Fatigue"style={{fontWeight:'normal'}}>Fatigue</Menu.Item>
              <Menu.Item key="Buckling"style={{fontWeight:'normal'}}>Buckling</Menu.Item>              
            </SubMenu>
          </Menu>
        </Col>
        <Col xs={16} lg={12}>
          <TowerViewSection>HI_00</TowerViewSection>
        </Col>
        <Col xs={24} lg={8}>
          <SettingSection>
            <CustomTabs defaultActiveKey="1">
              <TabPane tab="Tower Setup" key="1">
                Content of Tab Pane 1
              </TabPane>
              <TabPane tab="Segment Value" key="2">
                Content of Tab Pane 2
              </TabPane>
              <TabPane tab="ETC." key="3">
                Content of Tab Pane 3
              </TabPane>
            </CustomTabs>
          </SettingSection>
        </Col>
      </Row>
    </AppLayout>
  );
};

export default Home;
